// En el archivo Home.js
import React from 'react';
import './home.css'; // Importa el archivo CSS para los estilos

const Home = () => {
  return (
    <div className="home-container">
      <header className="hero-section">
        <h1>Bienvenido a Netnook</h1>
        <p>Descubre, guarda y comparte tus contenidos favoritos de manera fácil y rápida.</p>
        <button className="cta-button">¡Empezar Ahora!</button>
      </header>
      
      <section className="features-section">
        <div className="feature">
          <h2>Explora Contenidos</h2>
          <p>Accede a una amplia variedad de contenidos en un solo lugar.</p>
        </div>
        <div className="feature">
          <h2>Guarda tus Favoritos</h2>
          <p>Guarda tus contenidos preferidos para acceder a ellos cuando quieras.</p>
        </div>
        <div className="feature">
          <h2>Comparte con Amigos</h2>
          <p>Comparte tus descubrimientos con amigos y sigue sus recomendaciones.</p>
        </div>
      </section>
    </div>
  );
};

export default Home;
